import React from 'react';
import { View, ScrollView, Text,Dimensions } from 'react-native';

function Profile(props) {
    const window = Dimensions.get('window')

    return (
        <ScrollView style={{
            height: '100%',
            width: '100%',
            backgroundColor: 'red',
            flexDirection: 'column',
            
        }}>
        <TouchableOpacity style={{
                width: window.width / 5,
                height: window.width / 5,
                borderRadius: window.width / 10,
                backgroundColor: 'white',
                marginBottom: 30,
                position: 'absolute',
                zIndex: 40,
                bottom: 4,
                left: '40%',
                alignItems: 'center',
                shadowOffset:{
                    height:1,
                    width:1,
                },
                shadowColor:'black',
                shadowOpacity:.5,
                elevation:5,
                shadowRadius:'50%',

            }}>
                </TouchableOpacity>
            <View style={{
                height: 200,
                width: '100%',
                backgroundColor: 'black',
                borderBottomEndRadius: 50,
                borderBottomStartRadius: 50,

            }}>

                <View style={{
                    height:60,
                    width:60,
                    borderRadius:30,
                    backgroundColor:'white',
                    alignItems:'center',
                    overflow:'visible',
                    marginLeft:'40%',
                }}>

                </View>
            </View>


        </ScrollView>
    );
}

export default Profile;
